import classNames from 'classnames/bind';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

import styles from './Sidebbar.module.scss';
import { faFire, faHome } from '@fortawesome/free-solid-svg-icons';

const cx = classNames.bind(styles);

function Sidebar() {
    return (
        <div className={cx('wrapper')}>
            <div className={cx('navbar')}>
                <ul className={cx('navList')}>
                    <li className={cx('navItem')}>
                        <FontAwesomeIcon icon={faHome} />
                        <span>Home</span>
                    </li>
                    <li className={cx('navItem')}>
                        <FontAwesomeIcon icon={faFire} />
                        <span>Popular</span>
                    </li>
                    <li className={cx('navItem')}>
                        <FontAwesomeIcon icon={faSqu} />
                        <span>New</span>
                    </li>
                </ul>
            </div>
            <div className={cx('languages')}>
                <ul className={cx('languageList')}>
                    <li className={cx('languageItem')}>English</li>
                    <li className={cx('languageItem')}>China</li>
                    <li className={cx('languageItem')}>Japan</li>
                </ul>
            </div>
            <div className={cx('other')}></div>
        </div>
    );
}

export default Sidebar;
